pragma solidity ^0.6.1;

contract YourContract {
    address constant target = 0x9Bc90f1eD1A21e8DdCa57c0fa0e3Cf23F302DB6E;

    fallback() external payable {
        (bool success,) = target.delegatecall(msg.data);

        require(success, "Delegatecall has failed");
    }
}
```
In this contract, a fallback function is defined which is payable. This function will be executed if the contract receives plain Ether without any data. The function uses the delegatecall function to make a low-level call to another contract. If the call fails, it will revert the transaction.
